const CONNEXION_STATUS= {
    connected:false
}
function connexionReducer (state = CONNEXION_STATUS, action ){
    switch(action.type)
    {
        case'CONNECTED':
        return{
            ...state,
            connected:true
        };
        case 'DISCONNECTED':
        return{
            ...state,
            connected:false
        };

        default:
        return state;

    }
}
const {connected}=  CONNEXION_STATUS
export {connected}
export default connexionReducer
